import { Container } from 'react-bootstrap';
import './App.css';
import NavBar from './components/Navbar'
import Quote from './components/Quote';

function App() {
  return (
    <div className="App">
      <header>
        <NavBar />
      </header>
      <body>
        <Container>
          <Quote />
        </Container>
      </body>
    </div>
  );
}

export default App;
